const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre XXII", "p": 529}, {"t": "text", "c": ["- C\u2019est le temps que j\u2019ai perdu pour ma rose\u2026 fit le petit prince, afin de se souvenir. - Les hommes ont oubli\xE9 cette v\xE9rit\xE9, dit le renard. Mais tu ne dois pas l\u2019oublier. Tu deviens responsable pour toujours de ce que tu as apprivois\xE9.", "Tu es responsable de ta rose\u2026"], "p": 529}, {"t": "text", "c": ["- Je suis responsable de ma rose\u2026 r\xE9p\xE9ta le petit prince, afin de se souvenir."], "p": 530}, {"t": "text", "c": ["- Bonjour, dit le petit prince."], "p": 532}, {"t": "text", "c": ["- Bonjour, dit l\u2019aiguilleur."], "p": 533}, {"t": "text", "c": ["- Que fais-tu ici ? dit le petit prince."], "p": 534}, {"t": "text", "c": ["- Je trie les voyageurs, par paquets de mille, dit l\u2019aiguilleur. J\u2019exp\xE9die les trains qui les emportent, tant\xF4t vers la droite, tant\xF4t vers la gauche."], "p": 535}, {"t": "text", "c": ["Et un rapide illumin\xE9, grondant comme le tonnerre, fit trembler la cabine d\u2019aiguillage."], "p": 536}, {"t": "text", "c": ["- Ils sont bien press\xE9s, dit le petit prince.", "Que cherchent-ils ?"], "p": 537}, {"t": "text", "c": ["- L\u2019homme de la locomotive l\u2019ignore lui-m\xEAme, dit l\u2019aiguilleur."], "p": 538}, {"t": "text", "c": ["Et gronda, en sens inverse, un second rapide illumin\xE9."], "p": 539}, {"t": "text", "c": ["- Ils reviennent d\xE9j\xE0 ? demanda le petit prince\u2026"], "p": 540}, {"t": "text", "c": ["- Ce ne sont pas les m\xEAmes, dit l\u2019aiguilleur. C\u2019est un \xE9change."], "p": 541}, {"t": "text", "c": ["- Ils n\u2019\xE9taient pas contents, l\xE0 o\xF9 ils \xE9taient ?"], "p": 542}, {"t": "text", "c": ["- On n\u2019est jamais content l\xE0 o\xF9 l\u2019on est, dit l\u2019aiguilleur."], "p": 543}, {"t": "text", "c": ["Et gronda le tonnerre d\u2019un troisi\xE8me rapide illumin\xE9."], "p": 544}, {"t": "text", "c": ["- Ils poursuivent les premiers voyageurs ? demanda le petit prince."], "p": 545}]}';export{e as default};
